Cherry Poppin 'Daddies - White Teeth Black Thoughts (Deluxe Edition) (2013) MP3 320

White Teeth, Black Thoughts is the sixth studio album by American band the Cherry Poppin' Daddies, released on July 16, 2013 on Space Age Bachelor Pad Records. Following the predominant world music slant of 2008's Susquehanna and the 2009 ska album Skaboy JFK, White Teeth, Black Thoughts marks the Cherry Poppin' Daddies' first album since their 1997 compilation Zoot Suit Riot to focus exclusively on swing and jazz music, eschewing the ska, rock and pop influences which typically feature on their albums.

A two-disc &quot;deluxe&quot; version of White Teeth, Black Thoughts was released concurrently with the main swing album, featuring an additional full-length album of material composed in an &quot;Americana&quot; vein covering rockabilly, country and western swing.

